    type:ACTION_CONSTANTS.IS_BPM_TASK_LOADING,
    payload:data
  })
}

export const setBPMTaskDetailLoader = (data) => dispatch =>{
  dispatch({
    type:ACTION_CONSTANTS.IS_BPM_TASK_DETAIL_LOADING,
    payload:data
  })
}

